import React from 'react'
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import Slider from "react-slick";

const SlideShow2 = () => {

    var settings = {
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 1,
        slidesToScroll: 1
      };
      
  return (
    <div className='slide-container'>
      <Slider {...settings}>
        <div>
            <h1>hello</h1>
            <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Fuga repellat vel a optio consectetur odio rerum incidunt consequatur voluptatem, adipisci sint officiis quisquam quibusdam ex. Impedit, nemo explicabo? Aut, provident.</p>
        </div>
      </Slider>
    </div>
  )
}

export default SlideShow2
